import React, { useState, useContext } from "react";
import Frame from "../util/frame";
import { AppContext } from "../specification-wizard";

const ComprehensionLevel = () => {
  const [ladContext, setLadContext] = useContext(AppContext);

  return (
    <form className="needs-validation" novalidate>
      <div class="form-group row">
        <h3>Fine-grainded analysis of the situation</h3>
        <panel>
          Build the process that can help you build an accurate understanding of
          the situation at hand
        </panel>
        <hr className="my-1" />
      </div>
      <Frame />
    </form>
  );
};

export default ComprehensionLevel;
